interface Props {
  isCool: true | 'yes'  
}

export const ✨: FC<Props> = ({ isCool }) => {
  const [count, setCount] = useState(0)

  useEffect(() => {
    if(isCool) setCount(count => count + 1)
  }, [count])

  return (
    <section>
      <span>{count}</span>
    </section>
  )
}

const top5Packages = await axios.get( 'https://list-used-packages.limpix.workers.dev' ) .then(response => response.data) .then(data => Object.entries(data) .sort(([, a], [, b]) => b - a) .slice(0, 5) )
const isTypescript = top5Packages[0][0] === 'typescript'
